        <Navigation/>
        <h1>About</h1>
        <div>
        {personajes.map(personaje => (
        <div>
          <h3>{personaje.name}</h3>
          <p>{personaje.species}</p>
        </div>
      ))}
        </div>
        </div>
    )
}
About.getInitialProps =async function(){
    const res = await fetch('https://rickandmortyapi.com/api/character')
    const data = await res.json()
    return {
        data
    }
}
